  const [lName, setLName] = useState(props.peopleList.last_name);


  const ownerName = <h3 className='ownerName'>
    {fName} {lName}
    </h3>;


  return (
    <div>
      <div className="row">
        <div className="col-8" >
          {ownerName}
        </div>
        <div className="col-4">
          <ButtonGroup 
           person_id={props.peopleList.id}
           dispatch={props.dispatch}
          />

        </div> 
      </div>
      <div className="row">
        <div className="co1-8">
          {/**CarList */}
        </div>
        <div className="col-4">
          {/**button */}
        </div>
      </div>
    </div>
  )
}

export default List
